import React from 'react';

import styles from './Image.modules.css';

const image = props => {
    return (
        <img 
        src={props.src}
        className={styles.Image}
        
        style={{ 
        height: props.height, 
        width: props.width,
        position: props.position,
        boxShadow: props.shadow,
        border: props.border,
        borderRadius: props.bradius,
        }}>
        </img>
    )
};

export default image;
